def baseline_model(y_val):
  """Creates a baseline model that predicts the mean of the validation set.

  Args:
    X_val: Validation features.
    y_val: Validation labels.

  Returns:
    The mean squared error of the baseline model.
  """

  # Calculate the mean of the target variable
  mean_prediction = np.median(y_val)
  baseline_predictions = np.full_like(y_val, mean_prediction)

  # Evaluate the baseline model using Mean Squared Error
  mae = tf.keras.metrics.MeanAbsoluteError()
  mae.update_state(y_val, baseline_predictions)
  baseline_mae = mae.result().numpy()

  return baseline_mae

